    line-height: 19px;
    text-align: left;
`;


const Head = (props:any) => {



    return(
        <div style={{flex:1, backgroundColor:"#0F52BA", width:"100%", height:"101px",top:"-100px", alignItems:"center" }}>
            <div style={{flex:1, alignSelf:"flex-start", flexDirection:'row'}}>
                <Title style={{}}>
                    MKS
                </Title>
                <Subtitle>
                    Sistemas
                </Subtitle>
            </div>        
        </div>
    )

}

export default Head;
